import React from 'react'
import styles from './nav.module.scss'
import {Link} from 'react-router-dom'
import {SearchBar} from '../SearchBar/SearchBar'
import {MiniShop} from '../MiniShop/MiniShop'
import { allProducts } from '../../Redux/Actions'
import { useSelector, useDispatch } from "react-redux";
import { useEffect } from 'react'
import {Profile} from './Profile'
import logo from '../../../src/logo.svg';

export function Nav(){
const dispatch = useDispatch()
const temp = useSelector(state => state.Searchvalue)

useEffect(() => {
    if(temp === ''){
        dispatch(allProducts(1))
    }
})

    return (
        <div className={styles.div}>
        <Link to='/home'><img className={styles.img} src='https://images.squarespace-cdn.com/content/v1/5e3a928770897e641dceeaab/1589874757659-EY91JGOYIF31K7X9549S/black+and+blue+logo.png' alt='Elastacloud Img'/></Link>  
       <SearchBar></SearchBar>
       <MiniShop></MiniShop>
        <Link to='/carrito'><img className={styles.img2} src='data:image/png;base64,' /></Link>
         <Profile/>
        </div>
    )
}
